package com.example.hp.jsoup;

import android.content.Intent;
import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.util.Log;
import android.widget.Toast;

import org.jsoup.Connection;
import org.jsoup.Jsoup;
import org.jsoup.helper.HttpConnection;
import org.jsoup.nodes.Document;

import java.io.IOException;
import java.lang.reflect.Method;
import java.util.Map;

public class MainActivity extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        new Thread(new Runnable() {
            @Override
            public void run() {
                try {
                    getData();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        }).start();

    }
    private void getData() throws IOException {
        Document doc = Jsoup.connect("http://dkmh.epu.edu.vn/default.aspx")
                .data("ctl00$ContentPlaceHolder1$ctl00$ucDangNhap$txtTaiKhoa", "1381310069")
                .data("ctl00$ContentPlaceHolder1$ctl00$ucDangNhap$txtMatKhau", "060195")
                .data("__EVENTTARGET","")
                .data("__EVENTARGUMENT","")
                .data("__VIEWSTATE","")
                .data("ctl00$ContentPlaceHolder1$ctl00$ucDangNhap$btnDangNhap","Đăng Nhập")
                .userAgent("Mozilla")
                .ignoreHttpErrors(true)
                .followRedirects(true)
                .timeout(3000)
                .post();
        System.out.print(doc.toString());


    }



}
